import React from 'react'
import { Avatar, Button, IconButton } from '@mui/material'
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div className='bg-transparent flex p-5 justify-between items-center'>
      <div>
        <Link to='/'>
          <p className='text-2xl font-serif text-[#000a] font-bold uppercase'>Saadatu_blog</p>
        </Link>
      </div>
      {true ? (
        <div className='space-x-3'>
          <Button sx={{fontSize: 13, padding: 0.3, color: '#b6fff4'}}>Login</Button>
          <Button sx={{fontSize: 13, padding: 0.3, color: '#b6fff4'}}>Register</Button>
        </div>
      ): (
        <div className='flex items-center'>
          <IconButton>
            <Avatar sx={{width: 28, height: 28}} />
          </IconButton>
          <Button sx={{color: '#b6fff4', }} >Logout</Button>
        </div>
      )}
    </div>
  )
}

export default Header;
